INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "カリン", 118501, 118501, "2021/10/19 12:00:00", 37, 0, 2.0, 37, 0, 0, 118501, 118501, "2030/12/31 15:00:00", 0, "かりん", 0, 450, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 2, 787, 1, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "ネビア", 118601, 118601, "2024/08/10 21:00:00", 0, 0, 2.0, 0, 0, 0, 118601, 118601, "2030/12/31 15:00:00", 0, "ねびあ", 0, 450, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 2, 826, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 15, "イオ（ノワール）", 119001, 119001, "2021/11/03 19:00:00", 7, 0, 2.27, 7, 0, 0, 119001, 119001, "2030/12/31 15:00:00", 0, "いお", 0, 450, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 2, 714, 3, 0, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 12, "クウカ（ノワール）", 119101, 119101, "2021/11/16 12:00:00", 7, 0, 2.545, 26, 0, 0, 119101, 119101, "2030/12/31 15:00:00", 0, "くうか", 0, 450, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 2, 143, 3, 0, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 5, "マヒル（クリスマス）", 119201, 119201, "2023/09/19 15:00:00", 6, 0, 2.19, 6, 0, 0, 119201, 119201, "2030/12/31 15:00:00", 0, "まひる", 0, 450, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 1, 397, 1, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 6, "リノ（クリスマス）", 119301, 119301, "2021/12/22 12:00:00", 8, 0, 1.97, 8, 0, 0, 119301, 119301, "2030/12/31 15:00:00", 0, "りの", 0, 450, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 1, 762, 3, 0, 0);
