INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 14, "ミヤコ（クリスマス）", 119901, 119901, "2025/12/21 12:00:00", 1, 0, 2.17, 1, 0, 0, 119901, 119901, "2025/12/31 11:59:59", 0, "みやこ", 0, 450, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 1, 302, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 6, "シズル（ノワール）", 120001, 120001, "2025/03/10 12:00:00", 5, 0, 2.375, 5, 0, 0, 120001, 120001, "2025/03/15 14:59:59", 0, "しずる", 0, 450, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 1, 190, 3, 0, 1);
