INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 1, "シェフィ（ニューイヤー）", 120701, 120701, "2026/01/15 12:00:00", 4, 0, 1.84, 22, 0, 0, 120701, 120701, "2026/01/31 11:59:59", 0, "しぇふぃ", 0, 450, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 1, 283, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 2, "ルカ（ニューイヤー）", 120801, 120801, "2023/10/16 15:00:00", 4, 0, 1.3, 22, 0, 0, 120801, 120801, "2030/12/31 15:00:00", 0, "るか", 0, 450, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 1, 193, 1, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 12, "イリヤ（ニューイヤー）", 120901, 120901, "2026/01/15 12:00:00", 3, 0, 1.425, 38, 0, 0, 120901, 120901, "2026/01/31 11:59:59", 0, "いりや", 0, 450, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 2, 424, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 1, "ペコリーヌ（オーバーロード）", 121001, 121001, "2026/01/31 12:00:00", 5, 0, 2.25, 41, 0, 0, 121001, 121001, "2026/02/09 11:59:59", 0, "ぺこりーぬ", 0, 450, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 1, 164, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 1, "キャル（オーバーロード）", 121101, 121101, "2026/01/31 12:00:00", 7, 0, 2.07, 42, 0, 0, 121101, 121101, "2026/02/09 11:59:59", 0, "きゃる", 0, 450, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 2, 588, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 6, "ラビリスタ（オーバーロード）", 121201, 121201, "2023/11/16 15:00:00", 4, 0, 1.55, 40, 0, 0, 121201, 121201, "2030/12/31 15:00:00", 0, "らびりすた", 0, 450, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 1, 260, 1, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 3, "クルミ（ステージ）", 121301, 121301, "2022/03/03 19:00:00", 3, 0, 1.9, 3, 0, 0, 121301, 121301, "2030/12/31 15:00:00", 0, "くるみ", 0, 450, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 1, 731, 3, 0, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 15, "ミサキ（ステージ）", 121401, 121401, "2022/03/15 15:00:00", 7, 0, 2.27, 7, 0, 0, 121401, 121401, "2030/12/31 15:00:00", 0, "みさき", 0, 450, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 2, 742, 3, 0, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 12, "アユミ（怪盗）", 121501, 121501, "2025/04/26 12:00:00", 6, 0, 2.0, 6, 0, 0, 121501, 121501, "2025/04/30 11:59:59", 0, "あゆみ", 0, 450, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 1, 590, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 17, "イノリ（怪盗）", 121601, 121601, "2022/04/15 15:00:00", 3, 0, 1.425, 3, 0, 0, 121601, 121601, "2030/12/31 15:00:00", 0, "いのり", 0, 450, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 1, 292, 3, 0, 0);
