INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "ニノン（サマー）", 137101, 137101, "2025/08/15 15:00:00", 8, 0, 2.09, 47, 0, 0, 137101, 137101, "2030/12/31 15:00:00", 0, "にのん", 0, 450, "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 2, 566, 3, 0, 0);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "ラビリスタ", 0, 137201, "2015/04/01 15:00:00", 2, 0, 0.0, 2, 0, 0, 0, 137201, "2030/12/31 15:00:00", 0, "らびりすた", 0, 0, "", 0, 0, 3, 0, 0);
