INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "カスミ（シスター）", 137401, 137401, "2025/11/03 12:00:00", 7, 0, 2.09, 21, 0, 0, 137401, 137401, "2025/11/14 14:59:59", 0, "かすみ", 0, 450, "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", 2, 688, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "アイラ", 0, 137501, "2015/04/01 15:00:00", 1, 0, 0.0, 1, 0, 0, 0, 137501, "2030/12/31 15:00:00", 0, "あいら", 0, 0, "", 0, 0, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "コッコロ（嚮導幼君）", 137601, 137601, "2025/12/31 12:00:00", 7, 0, 2.09, 0, 0, 0, 137601, 137601, "2026/01/03 11:59:59", 0, "こっころ", 0, 450, "【魔法】後衛で、主さまを想い“進化”した嚮導の巫女。\n極大ダメージのＵＢで敵を穿ち、【進化超越】の権能によ\nって、味方のバフやダメージを、限界を超え成長させる。", 2, 733, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "ユキノ", 0, 137801, "2015/04/01 15:00:00", 7, 0, 0.0, 1, 0, 0, 0, 137801, "2030/12/31 15:00:00", 0, "ゆきの", 0, 0, "", 0, 0, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "リノ（ニューイヤー）", 137901, 137901, "2026/01/15 12:00:00", 8, 0, 2.09, 8, 0, 0, 137901, 137901, "2026/01/31 11:59:59", 0, "りの", 0, 450, "【魔法】後衛で絵馬に込めた想いを胸に抱く晴れ着の妹。\nクリティカル時に威力が上がる矢で敵を撃ち抜き、味方\n全体への攻撃支援や継続ＴＰ回復で厄を払い福を届ける。", 2, 684, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "ヴァイオレット（イサナミ）", 138001, 138001, "2026/01/31 12:00:00", 0, 0, 2.09, 0, 0, 0, 138001, 138001, "2026/02/09 11:59:59", 0, "うぁいおれっと", 0, 450, "【物理】前衛から慈愛の心で冥府を包む彼岸の屍姫。\nＵＢは敵全体を呑み込む割合ダメージを与え、【冥海の加\n護】を消費して味方の攻防ダウン効果までも禊ぎ清める。", 1, 154, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "ライラエル（パルフェクト）", 138101, 138101, "2026/02/09 12:00:00", 0, 0, 2.09, 0, 0, 0, 138101, 138101, "2026/02/15 11:59:59", 0, "らいらえる", 0, 450, "【魔法】後衛で、民とハーモニーを奏でる天使の姫君。\nステータスアップ効果を受け【エクスマキナ】が溜まると\n行動パターンが変化し、絶え間ない弓撃で神威を示す。", 2, 729, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "ネフィ＝ネラ（鬼面仏心）", 138201, 138201, "2026/02/15 12:00:00", 0, 0, 2.09, 0, 0, 0, 138201, 138201, "2026/02/28 11:59:59", 0, "ねふぃーねら", 0, 450, "【物理】中衛から怯懦を退け、万魔を率する煉獄の鉄媛。\n千変万化の躰は行動速度アップを始めとする多彩な支援と\nすべての敵の弱体を両立し、天地万象を掌の内に収める。", 1, 502, 3, 0, 1);
INSERT INTO `v1_50d23fd2806c196873eb7a1bc859b48b0dcc9d8226d6cdc8094044f068b6fa84` VALUES (0, 0, "サクラ", 0, 138601, "2015/04/01 15:00:00", 1, 0, 0.0, 1, 0, 0, 0, 138601, "2030/12/31 15:00:00", 0, "さくら", 0, 0, "", 0, 0, 3, 0, 1);
